import React from 'react';
import imageLogo from '../../assets/logoNav.png';
import eyes from '../../assets/eye.png';
import style from '../Eyes/EyeSeeYou.module.css'; 

const EyeSeeYou = () => {
    return(
        <body>  
            <main>
                <img id='anchor' src={imageLogo} alt="logo rick and morty" style={{width: '250px', height: '250px', position: 'fixed', top: '0px', left: '0px'}}/>
                <div id="eyes">
                        <img  src={eyes} alt="left eye" style={{position: 'absolute', width: '20px', height: '20px',top: '75px', left: '0px'}}/>
                        <img  src={eyes} alt="right eye" style={{position: 'absolute', width: '20px', height: '20px',top: '75px', left: '10px'}}/>
                </div>
            </main> 
        </body>
    )
}

export default EyeSeeYou;
